// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

import "./IDigiplaza.sol";
import "./Token.sol";


contract Digiplaza is ERC721, IDigiplaza,Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    uint256 public constant DAY = 86400;
    uint256 public constant FIFTEEN_MINUTES = 900;

    uint256 public constant AUCTION_TIME = DAY;
    uint256 public constant LAST_BIDDER_RESET_TIME = FIFTEEN_MINUTES;

    uint256 private FEE = 15;
    uint256 private TOKEN_FEE = 15;
    uint256 private NEXT_BID_PERCENTAGE = 5;
    address private TOKEN_ADDRESS;

    //event ListOnAuction (uint256 indexed tokenId, uint256 price);

    //Hashes helps to prevent from using the same hash
    mapping(string => uint8) hashes;

    // Mapping from token ID to metdata
    mapping(uint256 => string) private tokenMetaData;

    
    mapping(uint256 => Auction) private auctionList;

    constructor() ERC721("Digiplaza", "DIGIP") {}


    function mintNFT(address recipient, string memory _metadata, string memory _artwork ) public override returns (uint256) {
        require(hashes[_metadata] != 1);
        require(hashes[_artwork] != 1);

        hashes[_metadata] = 1;
        hashes[_artwork] = 1;

        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();
        _safeMint(recipient, newItemId);

        tokenMetaData[newItemId] = _metadata;
        emit Mint(recipient, newItemId, _artwork);
        return newItemId;
    }

    function listOnAuction(uint256 tokenId, uint256 price, CURRENCY currency ) public override returns (Auction memory) {
        require( ownerOf(tokenId) == msg.sender, "Digiplaza: Only owner can list the token to auction");
        require(!auctionList[tokenId].active, "Digiplaza: Already List in Auction" );

        uint256 endTime = AUCTION_TIME + block.timestamp;

        Auction memory newAuction = auctionList[tokenId];

        newAuction = Auction(true, msg.sender, address(0), price, endTime, currency );

        auctionList[tokenId] = newAuction;
        _transfer(msg.sender, address(this), tokenId);

        emit ListOnAuction(msg.sender, tokenId, price, endTime,  currency);

        return newAuction;
    }

    function bid(uint256 _tokenId) public payable override returns(Auction memory){
        Auction memory auctionItem = auctionList[_tokenId];
        require(auctionItem.active, "Digiplaza: Not in Auction");
        require(auctionItem.currency == CURRENCY.ETH, "Digiplaza: invalid currency type");

        if(block.timestamp > auctionItem.endTime){
            if(auctionItem.owner == address(0)){
                auctionItem.endTime = AUCTION_TIME + block.timestamp;
            }else{
               revert("Digiplaza: Auction Time Ended");
            }
        }
       // require( block.timestamp < auctionItem.endTime, "Digiplaza: Auction Time Ended");

        uint256 bidValueMust = auctionItem.value;
        bidValueMust = bidValueMust + (bidValueMust * NEXT_BID_PERCENTAGE / 100);
        require( bidValueMust <= msg.value, "Digiplaza: bid value must be greater than pervious bidder" );

        // release the funds to the old user
        if(auctionItem.owner != address(0)) {
            payable(auctionItem.owner).transfer(auctionItem.value);
        }
        auctionItem.owner = msg.sender;
        auctionItem.value = msg.value;
        
        uint256 remainingTime = auctionItem.endTime - block.timestamp;
        if (remainingTime < LAST_BIDDER_RESET_TIME) {
            auctionItem.endTime = LAST_BIDDER_RESET_TIME + block.timestamp;
        }

        auctionList[_tokenId] = auctionItem;

         emit Bid(msg.sender,  _tokenId, msg.value,  CURRENCY.ETH);

        return auctionList[_tokenId];
    }

    function bidToken(uint256 _tokenId, uint256 price) public override returns(Auction memory) {
        Auction memory auctionItem = auctionList[_tokenId];
        require(auctionItem.active, "Digiplaza: Not in Auction");
        require(auctionItem.currency == CURRENCY.TOKEN, "Digiplaza: invalid currency type");

        if(block.timestamp > auctionItem.endTime){
            if(auctionItem.owner == address(0)){
                auctionItem.endTime = AUCTION_TIME + block.timestamp;
            }else{
               revert("Digiplaza: Auction Time Ended");
            }
        }

        uint256 bidValueMust = auctionItem.value;
        bidValueMust = bidValueMust + (bidValueMust * NEXT_BID_PERCENTAGE / 100);
        require( bidValueMust <= price, "Digiplaza: bid value must be greater than pervious bidder" );
        require(Token(TOKEN_ADDRESS).allowance(msg.sender, address(this)) >= price, "Digiplaza: insufficient Allowance");

        Token(TOKEN_ADDRESS).transferFrom(msg.sender, address(this), price);

        if(auctionItem.owner != address(0)) {
            Token(TOKEN_ADDRESS).transfer(auctionItem.owner,auctionItem.value);
        }
        auctionItem.owner = msg.sender;
        auctionItem.value = price;
        
        uint256 remainingTime = auctionItem.endTime - block.timestamp;
        if (remainingTime < LAST_BIDDER_RESET_TIME) {
            auctionItem.endTime = LAST_BIDDER_RESET_TIME + block.timestamp;
        }

        auctionList[_tokenId] = auctionItem;

        emit Bid(msg.sender,  _tokenId, price, CURRENCY.TOKEN);

        return auctionList[_tokenId];
    }

    function claimNft(uint256 _tokenId) public override returns(uint256) {
        Auction memory auctionItem = auctionList[_tokenId];

        require(auctionItem.active, "Digiplaza: Not in Auction");

        require(block.timestamp > auctionItem.endTime, "Digiplaza: Auction Still onGoing");

        if ( auctionItem.creator == msg.sender || auctionItem.owner == msg.sender ) {

            if (auctionItem.owner == address(0)) {
                _transfer(address(this), auctionItem.creator, _tokenId);
            } else {
                _transfer(address(this), auctionItem.owner, _tokenId);

                if(auctionItem.currency == CURRENCY.ETH){
                    uint256 value = auctionItem.value - ((auctionItem.value * FEE) / 100);
                    payable(auctionItem.creator).transfer(value);
                }else{
                    uint256 value = auctionItem.value - ((auctionItem.value * TOKEN_FEE) / 100);
                    Token(TOKEN_ADDRESS).transfer(auctionItem.creator,value);
                }
            }

            delete auctionList[_tokenId];

            emit ClaimNft(auctionItem.owner, _tokenId);

            return _tokenId;
        } else {
            revert("Digiplaza: Must be Owner");
        }
    }

    
   


    function getTokenMetaData(uint256 _tokenId) public view override returns (string memory){
        require( _exists(_tokenId), "ERC721: approved query for nonexistent token" );
        return tokenMetaData[_tokenId];
    }

    function getAuction(uint256 _tokenId) public view override returns (Auction memory) {
        return auctionList[_tokenId];
    }

    function setTokenAddress(address tokenAddress) public override onlyOwner {
        TOKEN_ADDRESS = tokenAddress;
    }

    function setFee(uint256 fee, uint256 tokenFee) public override onlyOwner {
        FEE = fee;
        TOKEN_FEE = tokenFee;
    }

    function setNextBidPercentage(uint256 fee, uint256 tokenFee) public override onlyOwner {
        FEE = fee;
        TOKEN_FEE = tokenFee;
    }
    

    function withdraw(address _address, uint256 _value, CURRENCY currency) public override onlyOwner {

        if(currency == CURRENCY.ETH){
            payable(_address).transfer(_value);
        }else{
            Token(TOKEN_ADDRESS).transfer(_address,_value);
        }
    }


  }
